import React,{Component} from 'react';
import axios from "axios";

export default class Registration extends Component{
    constructor()
    {
        super()
    }


    uploadPics = async () => {
      let oName = document.getElementById("organismName").value;

      for (let i = 1; i < 5; i++) {
        let pic = "pic" + i;
        let fName = document.getElementById(pic).value;
        if (fName !== "") {
          fName = fName.replace(/.*[\\]/, "");

          const data = new FormData();
          data.append("file", document.getElementById(pic).files[0]);

          var dirPath = oName + "/";

          await axios
            .post("http://" + IP + ":8000/upload", data, {
              headers: { path: dirPath }
            })
            .then(res => {
              console.log(res.statusText);
            });
        }
      }
    };




    render()
    {
        return(
            <div className="formDiv">
              <center>
              <br/>
              <br/> <br/> <br/>
              <div className="myForm">              
                <form method="POST" action="/">
                  <table>
                  <tr> <td>&nbsp;</td> <td>&nbsp;</td>  <td>&nbsp;</td>   </tr>



                  <tr> <td>First Name</td>        <td>&nbsp;</td>            <td><input type="text" name="fname" required/></td>         </tr>
                  <tr> <td>&nbsp;</td> <td>&nbsp;</td>  <td>&nbsp;</td>   </tr>



                  <tr> <td>Last Name</td>        <td>&nbsp;</td>            <td><input type="text" name="lname" required /></td>         </tr>
                  <tr> <td>&nbsp;</td> <td>&nbsp;</td>  <td>&nbsp;</td>   </tr>



                  <tr> <td>Email Id</td>        <td>&nbsp;</td>            <td><input type="email" name="email" required /></td>         </tr>
                  <tr> <td>&nbsp;</td> <td>&nbsp;</td>  <td>&nbsp;</td>   </tr>



                  <tr> <td>Password</td>        <td>&nbsp;</td>            <td><input type="password" name="pass" required /></td>         </tr>
                  <tr> <td>&nbsp;</td> <td>&nbsp;</td>  <td>&nbsp;</td>   </tr>



                  <tr> <td>Re-Password</td>        <td>&nbsp;</td>            <td><input type="password" name="rpass"/></td>          </tr>
                  <tr> <td>&nbsp;</td> <td>&nbsp;</td>  <td>&nbsp;</td>   </tr>


                  <tr> <td>Gender</td>        <td>&nbsp;</td>            <td><input type="radio" name="sex" value="male" checked/> <label>Male</label> </td>         </tr>
                  <tr> <td>&nbsp;</td>        <td>&nbsp;</td>            <td><input type="radio" name="sex" value="female"/> <label>Female</label> </td>         </tr>



                  <tr> <td>&nbsp;</td> <td>&nbsp;</td>  <td>&nbsp;</td>   </tr>
                 <tr> <td>Photo</td>        <td>&nbsp;</td>            <td><input type="file" name="rpass" required/></td>          </tr>
                 <tr> <td>&nbsp;</td> <td>&nbsp;</td>  <td>&nbsp;</td>   </tr>



                 <tr> <td> <input type="reset"/> </td>           <td>&nbsp;</td>          <td><input type="submit" onClick={async () => {
                  await this.uploadData();
                }}/></td>         </tr>
                 <tr> <td>&nbsp;</td> <td>&nbsp;</td>  <td>&nbsp;</td>   </tr>







                 </table>
                 </form>
                </div>
                <br/><br/>
              </center>

            </div>

        );
    }
}
